import pandas as pd
import numpy as np
import scipy.stats as stats
from typing import Dict, Any, Optional, List
import warnings
import itertools
import re

def _get_metadata_mapping(doc_name: str) -> Dict[str, str]:
    """
    Maps a document name to its metadata (career_phase, event_type, audience).

    This function contains a hardcoded mapping based on the experiment specification
    and sample data provided. It is designed to be robust to variations in filenames.

    Args:
        doc_name: The document name (e.g., 'early_career/charlie_kirk_cpac_2020.txt').

    Returns:
        A dictionary containing 'career_phase', 'event_type', and 'audience'.
    """
    doc_name_lower = doc_name.lower()

    # Default values
    meta = {
        'career_phase': 'Unknown',
        'event_type': 'Unknown',
        'audience': 'Unknown'
    }

    # 1. Determine Event Type and Audience
    if 'cpac' in doc_name_lower:
        meta['event_type'] = 'CPAC'
        meta['audience'] = 'Conservative Activists'
    elif 'rnc' in doc_name_lower:
        meta['event_type'] = 'RNC'
        meta['audience'] = 'Republican Delegates'
    elif 'america_fest' in doc_name_lower or 'amfest' in doc_name_lower:
        meta['event_type'] = 'America Fest'
        meta['audience'] = 'TPUSA Supporters'
    elif 'sas' in doc_name_lower or 'student_action_summit' in doc_name_lower:
        meta['event_type'] = 'Student Action Summit'
        meta['audience'] = 'College Students'
    elif 'western_conservative_summit' in doc_name_lower:
        meta['event_type'] = 'Western Conservative Summit'
        meta['audience'] = 'Conservative Activists'
    elif 'college' in doc_name_lower:
        meta['event_type'] = 'College Speech'
        meta['audience'] = 'College Students'

    # 2. Determine Career Phase from year
    year_match = re.search(r'(201[89]|202[0-4])', doc_name_lower)
    if year_match:
        year = int(year_match.group(0))
        if year <= 2020:
            meta['career_phase'] = 'Early (<=2020)'
        elif 2021 <= year <= 2022:
            meta['career_phase'] = 'Mid (2021-2022)'
        else: # 2023-2024
            meta['career_phase'] = 'Late (2023-2024)'

    return meta

def _add_metadata_groups(data: pd.DataFrame) -> pd.DataFrame:
    """
    Adds grouping columns ('career_phase', 'event_type', 'audience') to the DataFrame.
    """
    if 'document_name' not in data.columns:
        return data

    meta_df = data['document_name'].apply(_get_metadata_mapping).apply(pd.Series)
    return pd.concat([data, meta_df], axis=1)

def _cronbach_alpha(df: pd.DataFrame) -> Optional[float]:
    """
    Calculates Cronbach's alpha for a given set of items (columns).
    """
    df = df.dropna()
    if df.shape[1] < 2 or df.shape[0] < 2:
        return None

    k = df.shape[1]
    item_vars = df.var(axis=0, ddof=1).sum()
    total_var = df.sum(axis=1).var(ddof=1)

    if total_var == 0:
        return 1.0 # Perfect correlation if no variance in total

    return (k / (k - 1)) * (1 - item_vars / total_var)

def calculate_descriptive_statistics(data: pd.DataFrame, **kwargs) -> Optional[Dict[str, Any]]:
    """
    Calculates descriptive statistics for all numeric dimensions and derived metrics.

    Methodology:
    This is an exploratory analysis. Given the small sample size (N < 15), results are
    suggestive rather than conclusive. This function computes the mean, standard
    deviation, median, 25th percentile (Q1), and 75th percentile (Q3) for all
    relevant numeric columns in the dataset.

    Args:
        data (pd.DataFrame): DataFrame containing the analysis data.
        **kwargs: Additional keyword arguments (unused).

    Returns:
        A dictionary of descriptive statistics for each variable, or None on error.
    """
    if data.empty:
        return {"warning": "Input data is empty.", "statistics": None}

    # Note: The framework specifies 'compersion', but the data structure provides 'compassion'.
    # We proceed using the 'compassion' columns as provided in the actual data.
    score_cols = [
        'tribal_dominance_raw', 'tribal_dominance_salience',
        'individual_dignity_raw', 'individual_dignity_salience',
        'fear_raw', 'fear_salience',
        'hope_raw', 'hope_salience',
        'envy_raw', 'envy_salience',
        'compassion_raw', 'compassion_salience',
        'enmity_raw', 'enmity_salience',
        'amity_raw', 'amity_salience',
        'fragmentative_goals_raw', 'fragmentative_goals_salience',
        'cohesive_goals_raw', 'cohesive_goals_salience'
    ]

    derived_cols = [
        'identity_tension', 'emotional_tension', 'success_tension', 
        'relational_tension', 'goal_tension', 'strategic_contradiction_index',
        'descriptive_cohesion_index', 'motivational_cohesion_index', 'full_cohesion_index'
    ]

    numeric_cols = [col for col in score_cols + derived_cols if col in data.columns]

    if not numeric_cols:
        return {"warning": "No numeric columns found for analysis.", "statistics": None}

    try:
        with warnings.catch_warnings():
            warnings.simplefilter("ignore", category=RuntimeWarning)
            desc_stats = data[numeric_cols].describe().to_dict()

        results = {}
        for col, stats_dict in desc_stats.items():
            results[col] = {
                'count': stats_dict.get('count', 0),
                'mean': stats_dict.get('mean', np.nan),
                'std': stats_dict.get('std', np.nan),
                'min': stats_dict.get('min', np.nan),
                'q1_25%': stats_dict.get('25%', np.nan),
                'median_50%': stats_dict.get('50%', np.nan),
                'q3_75%': stats_dict.get('75%', np.nan),
                'max': stats_dict.get('max', np.nan)
            }

        return {
            "analysis_tier": "Tier 3 (Exploratory)",
            "power_caveat": f"Exploratory analysis - results are suggestive rather than conclusive (N={len(data)}).",
            "statistics": results
        }
    except Exception as e:
        return {"error": f"Failed to calculate descriptive statistics: {str(e)}"}

def perform_correlation_analysis(data: pd.DataFrame, **kwargs) -> Optional[Dict[str, Any]]:
    """
    Performs a non-parametric correlation analysis between CFF dimension scores.

    Methodology:
    This is a Tier 3 (Exploratory) analysis. Due to the small sample size (N < 15),
    Spearman's rank-order correlation is used, as it is more robust to non-normality
    and outliers than Pearson's correlation. The function calculates the correlation
    coefficient (rho) and the p-value for each pair of raw score dimensions.

    Args:
        data (pd.DataFrame): DataFrame containing the analysis data.
        **kwargs: Additional keyword arguments (unused).

    Returns:
        A dictionary containing correlation results, or None on error.
    """
    if data.empty or len(data) < 3:
        return {"warning": f"Insufficient data for correlation analysis (N={len(data)}). Requires at least 3 data points."}

    raw_score_cols = [col for col in data.columns if col.endswith('_raw')]
    df_corr = data[raw_score_cols].dropna()

    if len(df_corr) < 3:
        return {"warning": f"Insufficient non-null data for correlation analysis (N={len(df_corr)})."}

    results = {}
    try:
        for col1, col2 in itertools.combinations(df_corr.columns, 2):
            rho, p_value = stats.spearmanr(df_corr[col1], df_corr[col2])
            key = f"{col1}__vs__{col2}"
            results[key] = {
                'rho': rho,
                'p_value': p_value
            }

        return {
            "analysis_tier": "Tier 3 (Exploratory)",
            "power_caveat": f"Exploratory analysis - results are suggestive rather than conclusive (N={len(df_corr)}). P-values should be interpreted with extreme caution.",
            "correlations": results
        }
    except Exception as e:
        return {"error": f"Failed to perform correlation analysis: {str(e)}"}


def perform_group_comparison_analysis(data: pd.DataFrame, **kwargs) -> Optional[Dict[str, Any]]:
    """
    Performs non-parametric group comparisons for CFF dimensions.

    Methodology:
    This is a Tier 3 (Exploratory) analysis. Given the very small group sizes (N < 5 per group),
    non-parametric tests are used. For variables with 2 groups, the Mann-Whitney U test is used.
    For variables with >2 groups, the Kruskal-Wallis H test is used. Results indicate potential
    patterns but are not statistically conclusive.

    Args:
        data (pd.DataFrame): DataFrame containing the analysis data.
        **kwargs: Additional keyword arguments (unused).

    Returns:
        A dictionary of group comparison results, or None on error.
    """
    if data.empty or len(data) < 3:
        return {"warning": f"Insufficient data for group comparison (N={len(data)})."}

    try:
        data = _add_metadata_groups(data)
        grouping_vars = ['career_phase', 'event_type', 'audience']
        metric_cols = [col for col in data.columns if '_raw' in col or '_index' in col]

        all_results = {}

        for group_by in grouping_vars:
            if group_by not in data.columns or data[group_by].nunique() < 2:
                continue

            group_results = {}
            for metric in metric_cols:
                groups = [group[metric].dropna() for name, group in data.groupby(group_by)]
                group_names = [name for name, group in data.groupby(group_by)]

                # Filter out empty groups
                valid_groups_data = [g for g in groups if not g.empty]
                valid_group_names = [gn for g, gn in zip(groups, group_names) if not g.empty]

                if len(valid_groups_data) < 2:
                    continue

                test_result = {}
                if len(valid_groups_data) == 2:
                    try:
                        stat, p_value = stats.mannwhitneyu(*valid_groups_data, alternative='two-sided')
                        test_result = {'test': 'Mann-Whitney U', 'statistic': stat, 'p_value': p_value}
                    except ValueError:
                        # Occurs if all values are the same
                        test_result = {'test': 'Mann-Whitney U', 'error': 'Cannot compute, all values are identical.'}
                else:
                    try:
                        stat, p_value = stats.kruskal(*valid_groups_data)
                        test_result = {'test': 'Kruskal-Wallis H', 'statistic': stat, 'p_value': p_value}
                    except ValueError:
                        test_result = {'test': 'Kruskal-Wallis H', 'error': 'Cannot compute, all values are identical.'}

                # Add descriptive stats for each group
                desc_stats = {}
                for i, group_data in enumerate(valid_groups_data):
                    desc_stats[valid_group_names[i]] = {
                        'n': len(group_data),
                        'median': group_data.median(),
                        'mean': group_data.mean(),
                        'std': group_data.std()
                    }
                test_result['descriptive_stats_by_group'] = desc_stats
                group_results[metric] = test_result

            all_results[f"comparison_by_{group_by}"] = group_results

        return {
            "analysis_tier": "Tier 3 (Exploratory)",
            "power_caveat": f"Exploratory analysis with very small group sizes (N={len(data)}). Results are suggestive of patterns, not statistically conclusive.",
            "group_comparisons": all_results
        }
    except Exception as e:
        return {"error": f"Failed to perform group comparison analysis: {str(e)}"}


def calculate_internal_consistency(data: pd.DataFrame, **kwargs) -> Optional[Dict[str, Any]]:
    """
    Calculates the internal consistency (Cronbach's alpha) for conceptual groups of dimensions.

    Methodology:
    This is a Tier 3 (Exploratory) analysis. Cronbach's alpha assesses how well a set of items
    (dimensions) measure a single underlying latent construct. We test two constructs:
    1. 'Fragmentative' dimensions: tribal_dominance, fear, envy, enmity, fragmentative_goals.
    2. 'Cohesive' dimensions: individual_dignity, hope, compassion, amity, cohesive_goals.
    Results should be interpreted with caution due to the small sample size (N < 15).

    Args:
        data (pd.DataFrame): DataFrame containing the analysis data.
        **kwargs: Additional keyword arguments (unused).

    Returns:
        A dictionary with Cronbach's alpha for each conceptual group, or None on error.
    """
    if data.empty or len(data) < 3:
        return {"warning": f"Insufficient data for reliability analysis (N={len(data)})."}

    try:
        fragmentative_dims = [
            'tribal_dominance_raw', 'fear_raw', 'envy_raw', 'enmity_raw', 'fragmentative_goals_raw'
        ]
        cohesive_dims = [
            'individual_dignity_raw', 'hope_raw', 'compassion_raw', 'amity_raw', 'cohesive_goals_raw'
        ]

        # Ensure columns exist
        fragmentative_dims = [col for col in fragmentative_dims if col in data.columns]
        cohesive_dims = [col for col in cohesive_dims if col in data.columns]

        alpha_fragmentative = _cronbach_alpha(data[fragmentative_dims])
        alpha_cohesive = _cronbach_alpha(data[cohesive_dims])

        return {
            "analysis_tier": "Tier 3 (Exploratory)",
            "power_caveat": f"Exploratory analysis - results are suggestive rather than conclusive (N={len(data)}).",
            "cronbach_alpha": {
                'fragmentative_construct': alpha_fragmentative,
                'cohesive_construct': alpha_cohesive
            },
            "note": "'compassion_raw' was used in the 'cohesive_construct' as a substitute for the framework's 'compersion' based on the available data structure."
        }
    except Exception as e:
        return {"error": f"Failed to calculate internal consistency: {str(e)}"}

def perform_statistical_analysis(data: pd.DataFrame, **kwargs) -> Dict[str, Any]:
    """
    Master function that executes all statistical analyses and returns combined results.

    Args:
        data (pd.DataFrame): pandas DataFrame containing analysis data.
        **kwargs: Additional parameters passed to individual functions.

    Returns:
        A dictionary containing the combined results from all statistical analyses.
    """
    results = {}

    if not isinstance(data, pd.DataFrame) or data.empty:
        return {"error": "Input data must be a non-empty pandas DataFrame."}

    # H4 & H5: Summarize tension and cohesion indices via descriptive stats
    results['descriptive_statistics'] = calculate_descriptive_statistics(data, **kwargs)

    # General exploration of relationships
    results['correlation_analysis'] = perform_correlation_analysis(data, **kwargs)

    # H1, H2, H3: Test for differences between groups
    results['group_comparison_analysis'] = perform_group_comparison_analysis(data, **kwargs)

    # Assess internal consistency of framework constructs
    results['internal_consistency_analysis'] = calculate_internal_consistency(data, **kwargs)

    return results
